    public static class TREES {

        public static final Registry<TreeGenerator> REGISTRY = new Registry<>("tree", StructureGenerator.REGISTRY);

        public static final TreeGenerator TREE_1 = REGISTRY.register("tree_1", TreeGenerator.builder().rule("FF+[+F-F-F]-[-F+F+F]").iterations(2)
                .leafSizeFunction((float normDistToCenter, boolean isOuterBranch) -> {
                    if (isOuterBranch) return 3;
                    return 2;
                }).branchThicknessFunction(i -> Math.max(1, 3 - i)).build());

        public static final TreeGenerator TREE_2 = REGISTRY.register("tree_2", TreeGenerator.builder().rule("FF+[+F-F-F]-[--F+F+F+F]").iterations(3).startLength(40f).angleIncrement((float) (Math.PI / 7f))
                .leafSizeFunction((float normDistToCenter, boolean isOuterBranch) -> {
                    if (isOuterBranch) return 5;
                    return 2;
                }).branchThicknessFunction(i -> switch (i) {
                    case 0 -> 7;
                    case 1, 2 -> 2;
                    default -> 1;
                }).build());

        public static final TreeGenerator TREE_3 = REGISTRY.register("tree_3", TreeGenerator.builder().rule("FF[-FF][FFF][+FF]").iterations(2).startLength(30f)
                .leafSizeFunction((float normDistToCenter, boolean isOuterBranch) -> {
                    if (isOuterBranch) return 3;
                    return 2;
                }).build());

        public static final TreeGenerator TREE_4 = REGISTRY.register("tree_4", TreeGenerator.builder().rule("F[-F][FF[-F][+F]]").iterations(2).startLength(18f).angleIncrement((float) (Math.PI / 6f))
                .leafSizeFunction((float normDistToCenter, boolean isOuterBranch) -> isOuterBranch ? 2 : 1)
                .branchThicknessFunction(i -> 1).build());

        public static final TreeGenerator TREE_5 = REGISTRY.register("tree_5", TreeGenerator.builder().rule("F[-FF]F[+FF][F]").iterations(3).startLength(60f)
                .leafSizeFunction((float normDistToCenter, boolean isOuterBranch) -> {
                    if (isOuterBranch) return 4;
                    return 2;
                }).branchThicknessFunction(i -> switch (i) {
                    case 0 -> 5;
                    case 1, 2 -> 2;
                    default -> 1;
                }).build());
    }

